import React, { useState } from 'react';
import { LayoutDashboard, CloudSun, TrendingUp, Database, Battery, MapPin, Zap, Calendar, Download , SomeIcon } from 'lucide-react';

// Mock Data
const mockData = {
  general: {
    location: { city: "Casablanca", lat: 33.5731, lon: -7.5898 },
    solar: { capacity: 750, panels: 1364, panelPower: 550 },
    batteries: {
      main: { capacity: 2500, soc: 87, status: "Charging" },
      backup: { capacity: 700, soc: 100, status: "Standby" }
    },
    buildings: [
      { name: "Hospital", consumption: 8.5, status: "Active" },
      { name: "Industry1", consumption: 15.2, status: "Active" },
      { name: "Office1", consumption: 4.3, status: "Active" }
    ]
  },
  weather: {
    current: { temp: 22, humidity: 65, cloudCover: 30, solar: 650, wind: 12 },
    forecast: Array.from({ length: 168 }, (_, i) => ({
      time: new Date(Date.now() + i * 3600000).toISOString(),
      temp: 18 + Math.sin(i / 12) * 8 + Math.random() * 2,
      solar: Math.max(0, 500 + Math.sin(i / 6) * 400 + Math.random() * 100),
      cloudCover: 20 + Math.random() * 40
    }))
  },
  consumption: {
    realtime: Array.from({ length: 24 }, (_, i) => ({
      hour: i,
      total: 30 + Math.sin(i / 4) * 15 + Math.random() * 5,
      hospital: 8 + Math.random() * 2,
      industry: 15 + Math.random() * 3,
      offices: 4 + Math.random() * 2,
      houses: 3 + Math.random() * 1
    })),
    predictions: Array.from({ length: 168 }, (_, i) => ({
      time: new Date(Date.now() + i * 3600000).toISOString(),
      predicted: 28 + Math.sin(i / 6) * 12 + Math.random() * 4,
      confidence: [25, 31]
    }))
  },
  archives: {
    weather: Array.from({ length: 720 }, (_, i) => ({
      time: new Date(Date.now() - (720 - i) * 3600000).toISOString(),
      temp: 20 + Math.sin(i / 24) * 6,
      solar: Math.max(0, 450 + Math.sin(i / 12) * 350)
    })),
    consumption: Array.from({ length: 720 }, (_, i) => ({
      time: new Date(Date.now() - (720 - i) * 3600000).toISOString(),
      total: 32 + Math.sin(i / 12) * 10,
      solar: Math.max(0, 20 + Math.sin(i / 12) * 18)
    }))
  }
};

const Dashboard = () => {
  const [activePage, setActivePage] = useState('overview');

  const navigation = [
    { id: 'overview', name: 'Vue Générale', icon: LayoutDashboard },
    { id: 'weather', name: 'Météo & Prévisions', icon: CloudSun },
    { id: 'consumption', name: 'Consommation', icon: TrendingUp },
    { id: 'archive-weather', name: 'Archive Météo', icon: Database },
    { id: 'archive-consumption', name: 'Archive Consommation', icon: Database }
  ];

  return (
    <div className="flex h-screen bg-gray-50">
      {/* Sidebar */}
      <div className="w-64 bg-gradient-to-b from-red-600 to-red-700 text-white">
        <div className="p-6">
          <div className="flex items-center gap-3 mb-8">
            <Zap className="w-8 h-8" />
            <div>
              <h1 className="text-xl font-bold">RenewStation</h1>
              <p className="text-xs text-red-100">Powered by Huawei</p>
            </div>
          </div>
          <nav className="space-y-2">
            {navigation.map(item => (
              <button
                key={item.id}
                onClick={() => setActivePage(item.id)}
                className={`w-full flex items-center gap-3 px-4 py-3 rounded-lg transition-all ${
                  activePage === item.id
                    ? 'bg-white text-red-600 shadow-lg'
                    : 'text-red-50 hover:bg-red-500'
                }`}
              >
                <item.icon className="w-5 h-5" />
                <span className="text-sm font-medium">{item.name}</span>
              </button>
            ))}
          </nav>
        </div>
      </div>

      {/* Main Content */}
      <div className="flex-1 overflow-auto">
        <div className="p-8">
          {activePage === 'overview' && <OverviewPage data={mockData.general} />}
          {activePage === 'weather' && <WeatherPage data={mockData.weather} />}
          {activePage === 'consumption' && <ConsumptionPage data={mockData.consumption} />}
          {activePage === 'archive-weather' && <ArchiveWeatherPage data={mockData.archives.weather} />}
          {activePage === 'archive-consumption' && <ArchiveConsumptionPage data={mockData.archives.consumption} />}
        </div>
      </div>
    </div>
  );
};

const OverviewPage = ({ data }) => (
  <div className="space-y-6">
    <h2 className="text-3xl font-bold text-gray-800">Vue Générale du Système</h2>
    
    {/* Location & Solar */}
    <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
      <Card title="Localisation" icon={MapPin}>
        <div className="space-y-2">
          <p className="text-2xl font-bold text-gray-800">{data.location.city}</p>
          <p className="text-sm text-gray-500">Lat: {data.location.lat} | Lon: {data.location.lon}</p>
        </div>
      </Card>
      
      <Card title="Installation Solaire" icon={Zap}>
        <div className="space-y-2">
          <div className="flex justify-between">
            <span className="text-gray-600">Capacité Totale</span>
            <span className="font-bold text-red-600">{data.solar.capacity} kWc</span>
          </div>
          <div className="flex justify-between">
            <span className="text-gray-600">Panneaux</span>
            <span className="font-bold">{data.solar.panels} × {data.solar.panelPower}W</span>
          </div>
        </div>
      </Card>
    </div>

    {/* Batteries */}
    <Card title="État des Batteries" icon={Battery}>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <BatteryStatus
          name="Principale"
          capacity={data.batteries.main.capacity}
          soc={data.batteries.main.soc}
          status={data.batteries.main.status}
        />
        <BatteryStatus
          name="Secours"
          capacity={data.batteries.backup.capacity}
          soc={data.batteries.backup.soc}
          status={data.batteries.backup.status}
        />
      </div>
    </Card>

    {/* Buildings */}
    <Card title="Bâtiments Connectés">
      <div className="space-y-3">
        {data.buildings.map((building, i) => (
          <div key={i} className="flex items-center justify-between p-3 bg-gray-50 rounded-lg">
            <div>
              <p className="font-semibold text-gray-800">{building.name}</p>
              <p className="text-sm text-gray-500">{building.status}</p>
            </div>
            <div className="text-right">
              <p className="text-lg font-bold text-red-600">{building.consumption} kW</p>
              <p className="text-xs text-gray-500">Consommation actuelle</p>
            </div>
          </div>
        ))}
      </div>
    </Card>
  </div>
);

const WeatherPage = ({ data }) => (
  <div className="space-y-6">
    <h2 className="text-3xl font-bold text-gray-800">Météo & Prévisions (7 jours)</h2>
    
    {/* Current Weather */}
